import React from 'react';
import { withRouter } from 'react-router-dom';

function HomePage({ history }) {
  const navigateToAbout = () => {
    history.push('/about');
  };

  return (
    <div className="home">
      <button className="top-button" onClick={navigateToAbout}>
        work
      </button>
    </div>
  );
}

export default withRouter(HomePage);
